import 'dart:convert';

import 'package:remote_control_app/core/error/exeption.dart';
import 'package:remote_control_app/core/init/logging/logger.dart';

import 'package:http/http.dart' as http;
import 'package:remote_control_app/feature/control_panel/data/models/shot_models/shot_model.dart';

abstract class DataStreamSource {
  Future<ShotModel> getCurrentShot(String ip);
}

class DataStreamSourceImpl extends DataStreamSource {
  final http.Client client;

  DataStreamSourceImpl({required this.client});

  @override
  Future<ShotModel> getCurrentShot(String ip) =>
      _getShotFromIp('$ip/api/frame');

  Future<ShotModel> _getShotFromIp(String url) async {
    logger.info("(Data source) Request shot for url: $url");
    try {
      final response = await client.get(Uri.parse(url));
      if (response.statusCode == 200) {
        final jsonShotData = json.decode(response.body);
        return ShotModel.fromJson(jsonShotData);
      } else if (response.statusCode == 503) {
        logger.info("Untreacked");
        throw ServerException();
      } else {
        logger.info("Other Server Exeption");
        throw ServerException();
      }
    } catch (e) {
      logger.info("Incorrect url");
      throw ServerException();
    }
  }
}
